const ignoredOptions = ['--null', '-z'];

export function statusTask(customArgs: string[]): StringTask<StatusResult> {
   const commands = [
      'status',
      '--porcelain',
      '-b',
      '-u',
      '--null',
      ...customArgs.filter((arg) => !ignoredOptions.includes(arg)),
   ];

